import React, { useEffect, useState } from 'react';
import axios from 'axios';
import "./eventDash.css"
import "../../App.css"

const EventsDash = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get('http://localhost:5001/api/events'); // Replace with your backend API endpoint
      setData(response.data);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div className='container'>
      <h1>Алдыдагы окуялар</h1>
      {data.map((item) => (
        <div key={item._id} className="events_card">
          <h2>{item.title}</h2>
          <img
        src={item.image}
        alt="events"
      />
        </div>
      ))}
    </div>
  );
};

export default EventsDash;
